  return (
    <CenterDiv>
      <Video />
      <Video />
      <Video />
    </CenterDiv>
  );
};

const CenterDiv = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  margin: 0 auto;
  width: 80rem;
`;

export default ReelsTest;
